import './Presentation.css';

function Presentation() {
  return(
    <section id='presentation-section' className='full-cover centered-content'>
      <hgroup id='presentation-text'>
        <h1>FRANCISCO MARIA</h1>
        <h3>Hi there,</h3>
        <h3>Glad you are here.</h3>
      </hgroup>
      <ul className='social-media-icons'>
        <li><a href='https://www.linkedin.com/in/francismaria/' ref='noreferer' target='_blank'><i className="fab fa-linkedin-in"></i></a></li>
        <li><a href='https://github.com/francismaria' target='_blank'><i className="fab fa-github"></i></a></li>
        <li><a href='https://medium.com/@francismariafms' target='_blank'><i className="fab fa-medium-m"></i></a></li>
        <li><a href='mailto:franciscomaria97@hotmail.com' target='_blank'><i className="fas fa-envelope"></i></a></li>
      </ul>
    </section>
  );
}

export default Presentation;
